import React from 'react';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch
} from 'react-router-dom';
// import Discover from './components/Popular';
// import DiscoverBattle from './components/DiscoverBattle';
// import MyList from './components/MyList';
// import Popular from './components/Discover';
// import PopularBattle from './components/PopularBattle';

import 'bootstrap/dist/css/bootstrap.min.css';

// https:api.themoviedb.org/3/discover/movie?sort_by=popularity.desc&api_key=c61a8e773fd1fa03c19a01c981e94bb6



class App extends React.Component {
  render() {
    return (
      <Router>
        <div>
          <nav>
            <ul>
              <li><Link to="/">This Week</Link></li>
              <li><Link to="/battle/">This Week Battle</Link></li>
              <li><Link to="/popular/">Popular</Link></li>
              <li><Link to="/popular-battle/">Popular Battle</Link></li>
              <li><Link to="/my-list/">My List</Link></li>
            </ul>
          </nav>
          <Switch>
            <Route path="/">
              <Discover />
            </Route>
            <Route path="/battle/">
              <DiscoverBattle />
            </Route>
            <Route path="/popular/">
              <MyList />
            </Route>
            <Route path="/popularbattle/">
              <Popular />
            </Route>
            <Route path="/mylist/">
              <PopularBattle />
            </Route>
          </Switch>
        </div>
      </Router>
    );
  }
}
export default App;
